import React, { Component } from 'react';
import { Card, CardBody, Row, Col } from 'reactstrap';

import firstresponders from '../assets/content/Home/firstResponders.jpg'

class Home extends Component {

    render() {
      return (
          <div>
        <Row>
            <Col>
            <Card>
                <CardBody><p>Hello world, This is the home page</p></CardBody>                    
            </Card>
            </Col>
        </Row>
        <Row>
            <Col>
            <Card>
                <CardBody>
                <img src='../assets/content/Home/firstResponders.jpg' class="img-fluid" alt="Responsive image"></img>
                </CardBody>
            </Card>
            </Col>
        </Row>
        </div>
    );
    }
  }
  
  
  export default Home;
